                {
                    "descriptionType": {
                        "descriptionTypeName": "Standard",
                        "descriptionTypeId": 6
                    },
                    "description": "<div id='eventDescription'><p> The Kent Island Running Group was founded in November 2009 by a group of Cross Island Trail \"regulars\" who wanted to meet the other \"regulars.?  Since then an informal weekly group run on Saturday mornings has begun.  In addition, we have evolved into race planners including the KI Metric Marathon and Half Metric in April and new in 2012 the Great Turkey Chase at Queenstown Harbor on Thanksgiving morning.  We also provide race support for Pumped for Pets, Al's Race and the KI Rock and Run.  Our mission is to provide a network of members with various running backgrounds a way to connect with other runners, and to share and improve their sport for better health and mental well being.</p></div><h5>Fees</h5><div id='eventFees'> <p>$15 per Individual</p></div>"
                },
                {
                    "descriptionType": {
                        "descriptionTypeName": "summary",
                        "descriptionTypeId": 4
                    },
                    "description": "<div id='briefDescription'> The KENT ISLAND RUNNING GROUP is a club for everyone ? not just the elite runners. There is a place for people of all levels of fitness from the social fitness walker to the most competitive racer.  </div>"
                }

                {
                    "descriptionType": {
                        "descriptionTypeName": "Standard",
                        "descriptionTypeId": 6
                    },
                    "description": "<br>If you have found yourself struggling with any of the aforementioned issues or just want some more personal attention, guidance, and direction around your running, an <b>Individual Coaching Session</b> may be just what you need!<br><BR> A typical 45-60 minute <b> Individual Coaching Session</b> includes the following for <b>$100</b>:<bR><BR> <ul> <li>Video Gait Analysis</li> <li>Analysis of Running Biomechanics & Form</li> <li>Overview of Proper Running Biomechanics & Form</li> <li>Creation of Personal Pace Chart</li> <li>Training guidance and direction</li> </ul><br> Something as simple as understanding proper running biomechanics and form can result in fewer aggravations/injuries AND improved running performance. <br><BR> Additionally, a little guidance and direction around your training can reinvigorate your running and lead to better performance. <br><BR> Upon purchase of your <a href=\"http://www.marathonmatt.com/personal.htm\"> Individual Coaching Session</a>, <B>I will email you directly to book an appropriate day/time for your session.</b><br><Br> <B><U>ALL INDIVIDUAL COACHING SESSIONS ARE CONDUCTED AT KEZAR TRACK IN SAN FRANCISCO, CA. 94117.</U></B><br><bR>"
                },
                {
                    "descriptionType": {
                        "descriptionTypeName": "summary",
                        "descriptionTypeId": 4
                    },
                    "description": "<br>Has your running performance <b>plateaud?</b><br><BR> Has your passion for running <b>waned</b>? <br><BR> Have you been <b>struggling</b> to overcome a nagging running related injury?<br><BR> These are all fairly common issues runners encounter, but it's not always obvious what you need to do to overcome these issues.<br><BR> If you have found yourself struggling with any of the aforementioned issues an <b>Individual Coaching Session</b> may be just what you need!"
                },
                {

                        "descriptionTypeName": "eventDonationLinks",

                    },
                    "description": "<eventDonationLinks/>"
                }

            "assetDescriptions": [
                {
                    "descriptionType": {
                        "descriptionTypeName": "Standard",
                        "descriptionTypeId": 6
                    },
                    "description": "<div id='eventDetails'> <div> <h5>Nelson Aspen's Central Park Sunrise Running Tour</h5><p>Millions of morning TV viewers around the world wake up with Entertainment reporter NELSON ASPEN. These days, he's seen on Australia's \"Sunrise\" and New Zealand's \"Good Morning.\" He's also regularly roused England (\"GMTV\" and \"This Morning\") and the USA (KABC Eyewitness News, WPIX Morning News and myriad radio stations). Now making Manhattan his home base, he's offering a unique opportunity for you to have a \"NYC RUNNING TOUR\" right in his own backyard: world-famous Central Park!</p></div><div> <h5>More Details</h5><p>His Sunrise run takes you on a 6 mile early morning jaunt around Central Park.  See the Jackie Onassis Reservoir, Strawberry Fields, Sheep's Meadow, the Finish Line of the NYC Marathon and many other iconic Manhattan sites.  Challenge yourself to run up \"Harlem Hill\" or stop for a photo beside the famed Egyptian Obelisk.  Check out the seasonal flora and fauna, as well as hidden treasures of art work.</p></div><div> <h5>More Details</h5><p>Maybe you'll even spot one of the many celebrities that likes to exercise in the Park: Madonna, Sting, Hoda Kotb, Edward Norton, Anthony Edwards or Tony Bennett might just bump into you!  Nelson will share trivia about the Park's history and, if you can keep a secret, plenty of juicy Entertainment news, too! If you like, he can point in you the direction of his favorite traditional Jewish deli where you can enjoy a hearty, post-run breakfast.</p></div><div> <h5>More Details</h5><p>Reservations of 2 or more will receive a signed copy of one of Nelson's many books (\"Let's Dish Up A Dinner Party!\" \"Hollywood Insider: Exposed!\" or \"Dinner at Nelson's\").  Pace will be determined by your fitness level...9:30/mile or more leisurely is recommended to ensure plenty of lung capacity for chat and photo ops!</p></div><div> <h5>More Details</h5><p>Run begins promptly at 8 am. Meeting location is the northeast corner of Central Park West and 72nd Street across from the Dakota Apartments. Water will be provided for each participant.</p>For questions or more information contact michael@cityrunningtours.com</p></div>  </div>"
                }
            ],

                    "description": "<div id='eventDetails'> <div> <h5>American Medical Athletic Association Membership</h5><p>As a member of the American Medical Athletic Association, you will receive the <i>AMAA Journal</i> 3x/year, website access to the American Running Association's (ARA) more than 1,500 articles on sports medicine and physical activity, bi-monthly e-mailed  issues of <i>e-Running & FitNews</i>, weekly e-mailed RUNNING MED NEWS,and the opportunity to earn CME credits at AMAA's symposiums 3x/year as well as eligibility to purchase a non-qualifying entry into the Boston Marathon.</p></div><div> <h5>Become a Premier Member</h5><p>AMAA Premier Membership recognition includes:<br>- Listing on AMAA website <br>- Acknowledgement at the Boston symposium<br>- Listing in <i>AMAA Journal</i> <br><BR>Premier gifts are (in addition to the AMAA membership t-shirt):<br><b>AMAA Supporter</b>($100): Dry-fit type running t-shirt<br><b>AMAA Patron</b>($150): AMAA embroidered mock turtleneck<br><b>AMAA Olympian</b>($250): AMAA quarter-zip running pullover<br></p></div>  </div><h5>Fees</h5><div id='eventFees'> <p>See regular membership fees above</p></div>"
